import React from "react";
import { Avatar } from "react-lorem-ipsum";


function Header(){
    return (
        <Box style={{
            display:"flex",
            justifyContent:"flex-start"
        }}>
            <Avatar />
            <Typography>Ashwin</Typography>
        </Box>
    )
}


export default Header;
